def find_Rotations(s):
    n = len(s)
    for i in range(1, n+1):
        if n % i == 0 and s[:i] * (n // i) == s:
            return n // i
    return n

def is_woodall(num):
    result = 1
    n = 1
    while result < num:
        result = n * (n + 1)
        if result == num:
            return True
        n += 1
    return False

