def amicable_numbers_sum(limit):
    def sum_divisors(n):
        return sum([i for i in range(1, n) if n % i == 0])

    def is_amicable(a, b):
        return a != b and sum_divisors(a) == b and sum_divisors(b) == a

    amicable_sum = 0
    for i in range(1, limit + 1):
        if is_amicable(i, sum_divisors(i)):
            amicable_sum += i

    return amicable_sum

