def pancake_sort(arr):
    def flip(arr, k):
        arr[:k+1] = arr[:k+1][::-1]

    n = len(arr)
    for curr_size in range(n, 1, -1):
        max_index = arr.index(max(arr[:curr_size]))
        if max_index != curr_size - 1:
            flip(arr, max_index)
            flip(arr, curr_size - 1)

    return arr

def pancake_sort(arr):
    def flip(arr, k):
        arr[:k+1] = arr[:k+1][::-1]

    def find_max_index(arr, n):
        max_index = 0
        for i in range(n):
            if arr[i] > arr[max_index]:
                max_index = i
        return max_index

    def pancake_sort_helper(arr, n):
        if n == 0:
            return
        max_index = find_max_index(arr, n)
        if max_index != n - 1:
            flip(arr, max_index)
            flip(arr, n - 1)
        pancake_sort_helper(arr, n - 1)

    pancake_sort_helper(arr, len(arr))
    return arr

