def count_Primes_nums(num):
    if num < 2:
        return 0
    primes = [True] * num
    primes[0] = primes[1] = False
    for i in range(2, int(num ** 0.5) + 1):
        if primes[i]:
            primes[i*i:num:i] = [False] * len(primes[i*i:num:i])
    return sum(primes)

def is_prime(num):
    if num < 2:
        return False
    for i in range(2, int(num ** 0.5) + 1):
        if num % i == 0:
            return False
    return True

